ls ceux qui parviennent à dominer leur peur pourront survivre…\",\"poster_path\":\"/qpyaW4xUPeIiYA5ckg5zAZFHvsb.jpg\",\"media_type\":\"movie\",\"genre_ids\":[878,12],\"popularity\":126.311,\"release_date\":\"2021-09-08\",\"video\":false,\"vote_average\":7.843,\"vote_count\":8006},{\"adult\":false,\"backdrop_path\":\"/urwWVsciRiNSmhtMJcck0noWAXr.jpg\",\"id\":504949,\"title\":\"Le Roi\",\"original_language\":\"en\",\"original_title\":\"The King\",\"overview\":\"Hal, jeune prince rebelle, tourne le dos à la royauté pour vivre auprès du peuple. Mais à la mort de son père, le tyrannique Henri IV d'Angleterre, Hal ne peut plus échapper au destin qu'il tentait de fuir et est couronné roi à son tour. Le jeune Henri V doit désormais affronter le désordre politique et la guerre que son père a laissés derrière lui, mais aussi le passé qui resurgit, notamment sa relation avec son ami et mentor John Falstaff, un chevalier alcoolique.\",\"poster_path\":\"/3JPoaxHgGUQ3akCk9xPrSKING8O.jpg\",\"media_type\":\"movie\",\"genre_ids\":[18,36,10752],\"popularity\":22.131,\"release_date\":\"2019-10-11\",\"video\":false,\"vote_average\":7.164,\"vote_count\":2693}]},{\"adult\":false,\"id\":3453397,\"name\":\"雷火剑\",\"original_name\":\"雷火剑\",\"media_type\":\"person\",\"popularity\":4.984,\"gender\":0,\"known_for_department\":\"Directing\",\"profile_path\":null,\"known_for\":[]},{\"adult\":false,\"id\":287,\"name\":\"Brad Pitt\",\"original_name\":\"Brad Pitt\",\"media_type\":\"person\",\"popularity\":62.533,\"gender\":2,\"known_for_department\":\"Acting\",\"profile_path\":\"/ajNaPmXVVMJFg9GWmu6MJzTaXdV.jpg\",\"known_for\":[{\"adult\":false,\"backdrop_path\":\"/1Jpkm9qZcsT0mSyVXgs4VlGjPNI.jpg\",\"id\":16869,\"title\":\"Inglourious Basterds\",\"original_language\":\"en\",\"original_title\":\"Inglourious Basterds\",\"overview\":\"Dans la France occupée de 1940, un groupe de soldats juifs américains, les bâtards, mène des actions punitives particulièrement sanglantes contre les nazis du Troisième R