ntraints de mener une double vie qui leur fait perdre leurs repères et leur identité. Traquenards et contre‐offensives s’enchaînent jusqu’au jour où chaque camp réalise qu’il héberge une taupe. Une course contre la montre s’engage entre les deux hommes avec un seul objectif: découvrir l’identité de l’autre sous peine d’y laisser sa peau…\",\"poster_path\":\"/xHeuF5zzlx1YxkULiz0mx1TMBJ7.jpg\",\"media_type\":\"movie\",\"genre_ids\":[18,53,80],\"popularity\":43.407,\"release_date\":\"2006-10-04\",\"video\":false,\"vote_average\":8.162,\"vote_count\":12907}]},{\"adult\":false,\"id\":85,\"name\":\"Johnny Depp\",\"original_name\":\"Johnny Depp\",\"media_type\":\"person\",\"popularity\":30.643,\"gender\":2,\"known_for_department\":\"Acting\",\"profile_path\":\"/dHvp2FafEE5OGFy9kcX2l8oMIsH.jpg\",\"known_for\":[{\"adult\":false,\"backdrop_path\":\"/jOh79POQu4hyVIseUxdQxTW7vOf.jpg\",\"id\":22,\"title\":\"Pirates des Caraïbes : La Malédiction du Black Pearl\",\"original_language\":\"en\",\"original_title\":\"Pirates of the Caribbean: The Curse of the Black Pearl\",\"overview\":\"Petite, Elizabeth Swann, la fille du gouverneur, a sauvé de la noyade Will Turner après le naufrage de son bateau. Les années ont passé, Will et Elizabeth ont grandi. Will est devenu forgeron à Port Royal, et Elizabeth se prépare à épouser le commodore Norrington. Cependant, la vie d'Elizabeth bascule lorsque le capitaine Barbossa et sa bande de pirates décident d'attaquer Port Royal et la prennent en otage. Malheureusement pour lui, Barbossa a commis deux erreurs.\",\"poster_path\":\"/jFmc6zbnx6mSoxejECYvdi3IHIs.jpg\",\"media_type\":\"movie\",\"genre_ids\":[12,14,28],\"popularity\":111.458,\"release_date\":\"2003-07-09\",\"video\":false,\"vote_average\":7.78,\"vote_count\":18116},{\"adult\":false,\"backdrop_path\":\"/8zfRLCgKrLAc5SSnACz8ZqmeKAP.jpg\",\"id\":58,\"title\":\"Pirates des Caraïbes : Le Secret du coffre maudit\",\"original_language\":\"en\",\"original_title\":\"Pirates of the Caribbean: Dea